import React from "react";
import store from "store";
import { useHistory } from "react-router-dom";
import Login from "../../components/forms/Login";
import { User_api } from "../../api/user_api";
import BPSuccessNotification from "../../components/common/BPNotification";

const SignIn = () => {
  const [successModal, setSuccessModal] = React.useState(false);
  const [message, setMessage] = React.useState(false);
  const history = useHistory();

  const submit = async fields => {
    const res = await User_api.SignIn(fields);
    if (res.code != 200) {
      setMessage(res.data.message);
      setSuccessModal("true");
    } else {
      store.set(
        "user",
        { apiKey: res.data.error.apiKey },
        { secretKey: res.data.error.secretKey },
        { admin_id: res.data.error.adminKey }
      );
      history.push(`/vendor`);
    }
  };

  return (
    <React.Fragment>
      <Login submit={submit} />
      {successModal && <BPSuccessNotification message={message} />}
    </React.Fragment>
  );
};

export default SignIn;
